import React from 'react'
// import { data } from '../Config/Data'
import Cards from './Cards'
import img from "../Images/Recruiting.png"
import img1 from "../Images/Stream.png"

export const data = [
    {img : img , Projects : "Recruiting App", Name: "Mobile App"},
    {img : img1 , Projects : "Stream+", Name: "Mobile App"},
]

const details = () => {
  return (
    <div className='h-[500px] w-[500px]'>
      {data.map((it) =>{
        return <div>
          <img src={img1} alt='' />
        </div>
      })}
    </div>
  )
}

export default details
